        return True

    def union(a, b):
        a_set = set(a)
        b_set = set(b)
        if len(a_set.intersection(b_set)) > 0:
            return a
        return a + b

    def find_path(from_, to_):
        if from_ == to_:
            return [from_]
        for edge in edges:
            if is_valid(edge[0], edge[1], from_) and is_valid(edge[0], edge[1], to_):
                path = find_path(edge[0], to_)
                if len(path) > 0:
                    return union(path, [edge[1]])
        return []

    def get_count(a, b, c):
        path_a = find_path(a, b)
        path_b = find_path(a, c)
        path_c = find_path(b, c)
