    # create dictionary with numbers: divisors
    dic = {}
    for i in numbers:
        div = [1, i]
        for j in range(2, int(i ** 0.5) + 1):
            if i % j == 0:
                div.append(j)
                div.append(i // j)
        div.sort()
        if i not in dic:
            dic[i] = set(div)
        else:
            dic[i] = dic[i].intersection(set(div))

    # find two numbers which share all divisors and are in ascending order
    x = 1
    y = 1
    for key in dic:
        if len(dic[key]) == len(numbers):
            for i in range(2):
                x *= key
                for val in dic[key]:
                    if i == 0:
                        y *= val
                    else:
                        y *= key
                if x == y:
                    return f'{x} {y}'
    return None

