def solution(stdin: str) -> str:
    """
    Calculates minimum number of pockets Polycarp needs to distribute all the coins so no two coins with the same value are put into the same pocket.

    >>> solution("6\n1 2 4 3 3 2")
    2
    """
    num = int(stdin.readline().strip())
    coins = list(map(int, stdin.readline().strip().split(" ")))

    # We need to find the indexes of the distinct values of the array, so we can create the dictionary with the index as a key and the number of repetitions as a value
    # Ex. If we have the array [2, 3, 3, 1] and we have the distinct values [2, 3], then the dictionary would look like {0: 2, 1: 1}
    dictionary = {}
    for i, coin in enumerate(coins):
        if coin in dictionary:
            dictionary[coin].append(i)
        else:
            dictionary[coin] = [i]

    # Sort the indexes in the dictionary by the number of repetitions (values)
    # Ex. If we have the dictionary {0: 2, 1: 1} then it would be transformed to {1: 1, 0: 2}
    dictionary = {k: v for k, v in sorted(dictionary.items(), key=lambda item: len(item[1]))}

    # Create a new dictionary where we put the number of values in each index to be able to calculate the number of possible groups
    dictionary_count = {}
    for key, values in dictionary.items():
        dictionary_count[key] = len(values)

    # Initialize the array with the number of groups (possible groupings)
    groups = [dictionary_count[key] for key in dictionary_count]

    # Calculate the number of groups that have no value that is repeated
    groups.append(0)

    # The number of groups is the minimum of the number of groups
    number_of_groups = min(groups)

    # Return the answer
    return number_of_groups

