            if dfs(0, length, visited, used):
                return True
            visited.pop()
            used[(length - 1) // (k - len(visited)) - 1] = 0
        if dfs(i + 1, length + roads[i][0], visited + [{roads[i][0]}], used + [0]):
            return True
        if dfs(i + 1, length + roads[i][1], visited + [{roads[i][1]}], used + [1]):
            return True
        return False

    for i in range(m):
        if dfs(i, 0, [set()], []):
            return "".join([str(i + 1) for i in range(k) if used[i] == 0]) + "\n" + "".join([str(i + 1) for i in range(k) if used[i] == 1])

